import React from 'react';

const KnowMorePage = () => {
  return (
    <div
      style={{
        height: '100vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: 'black',
        color: 'white',
        fontSize: '40px',
        fontWeight: 'bold',
      }}
    >
      Welcome to the Know More Page!
    </div>
  );
};

export default KnowMorePage;
